import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header >
        Hola
      </header>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hola!
        </p>
      </header>
    </div>
  );
}

export default App;
